	add("pornophobia", "{\"term\":\"pornophobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|porno|phobia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Dislike, disapproval, fear, intolerance, or animosity and hatred toward sexuality, pornography, nakedness, nude art, and sexual imagery or tex\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027 Quest\u0026lt;!---[http://books.google.com/books?id\u003dVkwZAAAAIAAJ\u0026amp;q\u003dpornophobia\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d6\u0026amp;ved\u003d0CEEQ6AEwBQ]---\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Fear of pronography, or \u0027\u0027 \u0027pornophobia\u0027 \u0027\u0027 as I choose to call it, is a terribly unbalancing mental condition\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027 Read, reason, write\u0026lt;!---[http://books.google.com/books?id\u003dcEWqMBiLRw8C\u0026amp;q\u003dpornophobia\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDUQ6AEwAg]---\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Perils of \u0027\u0027Pornophobia\u0027\u0027 Nadine Strossen Earning her law degree at Harvard University\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 Unrepentant Whore\u0026lt;!---[http://books.google.com/books?id\u003dPthxt1aCnFEC\u0026amp;pg\u003dPA30\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d7\u0026amp;ved\u003d0CEUQ6AEwBg]---\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I don\u0027t want to fight my sisters, and \u0027\u0027pornophobia\u0027\u0027 is not quite a recognized social ill at this point, so I just better relax\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 Pornology\u0026lt;!---[http://books.google.com/books?id\u003dIAI5cHdGlmcC\u0026amp;pg\u003dPA13\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d9\u0026amp;ved\u003d0CE8Q6AEwCA]---\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"“\u0027\u0027Pornophobic\u0027\u0027?” That\u0027s his response to my impassioned arguments about why porn is anti-feminist and misogynistic\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Some feminists laugh at claims of \u0027\u0027pornophobia\u0027\u0027 for their opposition to porn and art, but this is something third wave feminists do recognize\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Fear of prostitute\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027 Uncontrollable Bodies\u0026lt;!---[http://books.google.com/books?id\u003dzL0zAQAAIAAJ\u0026amp;q\u003dpornophobia\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d10\u0026amp;ved\u003d0CFQQ6AEwCQ]---\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Pornophobia\u0027\u0027 means the fear of prostitutes\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A lot of medics from Asia and Africa bring backward attitudes with them into the workplace leading to poor treatment of sex workers because of their \u0027\u0027pornophobia\u0027\u0027 making them uncomfortable dealing and effectively discussing important medical concerns such as condom usage, STD treatment, and prevention\", \"priority\":14}]}, \"synonyms\":{}}");

